import react from "react";
import {BrowserRouter, Switch, Route} from "react-router-dom";
import Navigation from "./components/layout/Navigation"

const Router = () =>{
    return(
        <BrowserRouter>
            <Navigation/>
            <Switch>
                <Router exact path="/">home</Router>
                <Router exact path="/about">home</Router>
                <Router exact path="/">home</Router>
                <Router exact path="/">home</Router>
            </Switch>
        </BrowserRouter>
    );
}
